import Vue from 'vue'
import VueRouter from 'vue-router'
Vue.use(VueRouter);
import Home from '@/views/Home'

const router = new VueRouter({
    mode:'history',
    routes:[
        {
            name:'home',
            path:'/home',
            component:Home,
            children:[
                {
                    name:'detail',
                    path:'detail',
                    component:()=>import('@/views/Detail')
                }
            ]
        },
        {
            path:'/test',
            component:()=>import('@/views/Test') 
        },
        {
            name:'login',
            path:'/login',
            component:()=>import('@/views/Login') 
        },
        {
            path:'/',
            component:Home
        }
    ]
})

export default router
